import { useState } from 'react';

  const Cont = () => {

    const[conts,setCont] = useState([
        {
        'id' : "1:",
        'sml' : "yes",
        'nam' : "Presbo",
        'email' : 'presbo@columbia.edu'
        },

        {
        'id' : "2:",
        'sml' : "no",
        'nam' : "John Jay Mouse",
        'email' : 'mouse@columbia.edu'
        },


        { 
        'id': "3",
        'small': 'no', 
        'nam': "Water Bottle Man",
        'email' : 'flipper@columbia.com' 
        },


      ])



      return (
        <>
          {conts.map((cont) => (
             <Data num = {cont.id} sml = {cont.sml} nam = {cont.nam} email = {cont.email}/>
          ))}
        </>
      );
    };

  export default Cont
